import React from 'react';
import MainStack from '../MainStack/MainStack';

function Techs ({children}) {
    return (
        <div>
            <MainStack stackName = {'Технологии'}>
            <h1 className="Promo__title">7 технологий</h1>
            {children}
            <main>
            <div className="btn__container">
                    <Button> Кнопка по умолчанию </Button>
                    <Button color = "red"> Красная кнопка </Button>
                    <Button color = "black"> Черная кнопка </Button>
                    <Button type = "secondary"> Кнопка "Каркас" </Button>
                <Button type="secondary" color="red">
                        Кнопка каркаса
                </Button>
                <Button type="secondary" color="black">
                        Кнопка каркаса
                </Button>
            </div>
            </main>
            </MainStack>
        </div>
    );
}

export default Techs;
